import React from 'react';

const CallWindow = ({ type, onEndCall }) => (
  <div className="fixed inset-0 bg-black bg-opacity-70 flex flex-col justify-center items-center z-50 p-6">
    <div className="bg-white rounded-lg p-6 w-96 text-center">
      <h2 className="text-xl font-bold mb-4">In {type} call</h2>
      <button
        onClick={onEndCall}
        className="bg-red-600 text-white px-4 py-2 rounded hover:bg-red-700"
      >
        End Call
      </button>
    </div>
  </div>
);

export default CallWindow;
